import React from "react";
import styled from "styled-components";

function Home() {
  return (
    <Container>
      <Nav>
        <Logo>TABI</Logo>
      </Nav>
    </Container>
  );
}

export default Home;
const Container = styled.div`
  width: 100vw;
  display: flex;
  flex-direction: column;
`;
const Nav = styled.div`
  width: 100vw;
  height: 100px;
  padding: 30px;
`;
const Logo = styled.p`
  font-size: 40px;
  font-weight: 700;
`;
